import React from 'react';

const About = () => {
    return (
        <main>
            <div className='about-wrapper'>
                <h1>Hello, I'm Luca</h1>
                <div className='about'>
                    <img src="../" alt='about-image'></img>
                    <div className='about-text'>
                        <h2>Nice to meet you</h2>
                        <p>I'm a Web Developer and Designer from Austria.
                            I'll have you know I graduated top of my class in the Navy Seals, and I've been involved in numerous
                            secret raids on Al-Quaeda, and I have over 300 confirmed kills. I am trained in gorilla warfare and
                            I'm the top sniper in the entire US armed forces. You are nothing to me but just another target. I
                            will wipe you the fuck out with
                            precision the likes of which has never been seen before on this Earth, mark my fucking words.
                        </p>
                    </div>
                </div>
            </div>
        </main>
    );
};

export default About;
